('000000000009', '00005', '000000020', '', 'Ноутбук ASUS TUF Gaming FX505DT-HN564T черный', 'Производительность ноутбука ASUS TUF Gaming FX505DT-HN507T обеспечивается четырехъядерным процессором AMD Ryzen 5 3550H с рабочей частотой 2.1 ГГц, Он обладает широким функционалом, может использоваться для динамичных игр, выполнения других операций, касающихся учебы или работы. Отличается прекрасной графикой, чистым звуком, четким и ярким изображением.\n\nНоутбук ASUS TUF Gaming FX505DT-HN507T оснащен экраном диагональю 15.6 дюйма с матрицей IPS и с разрешением 1920х1080. Лэптоп может использоваться для просмотра фильмов и сериалов, для работы с видеоконтентом различного содержания. Поддерживает технологии Wi-Fi и Bluetooth. Для долгосрочного хранения данных на SSD диске предусмотрено 256 Гб. Для подключения сторонних устройств и носителей информации используются предусмотренные порты и разъемы. Литий-ионная батарея обеспечивает автономную работу в течение нескольких часов.', '1655299', '', '', '000007', NULL, NULL, 20),
