('000000000015', '00005', '000000006', '', 'Смартфон Xiaomi Redmi 9 (белый)', 'Huawei Honor 7A - смартфон с современным дизайном. На передней стороне размещается прочное и красивое 2,5D-стекло.\nТыльная сторона является матовой, а реализована она из высококачественного алюминия.\n\nДисплей в Honor 7A установлен 5,45-дюймовый FullView-дисплей с разрешением 1440x720.\n\nСмартфон Honor 7A оснащен 4-х ядерным процессором Mediatek MT6739. Здесь используются ядра Cortex-A53, которые работают на максимальной частоте 1500 МГц. В устройстве располагается ускоритель графики PowerVR GE8100.\n\nВстроенная память 16 Гб и 2 Гб оперативной памяти, а расширить внутреннее хранилище можно с помощью карт памяти до 256 Гб.\n\nAndroid 8.1 выступает в качестве операционной системы. При этом интерфейс модернизирован благодаря фирменной оболочке EMUI 8.1.\n\nВнутри аппарата находится несъемный аккумулятор с емкостью 3020 мАч.\n\nHuawei Honor 7A поддерживает две Nano-SIM одновременно. При этом карта памяти может быть установлена отдельно.\n\nИмеется встроенное FM-радио, а также модуль LTE.\n\nКамера\nВ Hu', '1670750', '', '[{\"id\":\"000000072\",\"index\":1,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000001\",\"index\":2,\"is_title\":false,\"type\":8,\"value\":\"156\"},{\"id\":\"000000004\",\"index\":3,\"is_title\":false,\"type\":7,\"value\":\"000000004\"},{\"id\":\"000000014\",\"index\":4,\"is_title\":false,\"type\":4,\"value\":\"000000011\"},{\"id\":\"000000025\",\"index\":5,\"is_title\":false,\"type\":4,\"value\":\"000000015\"},{\"id\":\"000000028\",\"index\":6,\"is_title\":false,\"type\":1,\"value\":\"сканер отпечатка пальца; быстрая зарядка; технология распознавания лица\"},{\"id\":\"000000032\",\"index\":7,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000029\",\"index\":8,\"is_title\":false,\"type\":2,\"value\":6.5},{\"id\":\"000000036\",\"index\":9,\"is_title\":false,\"type\":4,\"value\":\"000000039\"},{\"id\":\"000000037\",\"index\":10,\"is_title\":false,\"