('000000000016', '00001', '000000011', '', 'Димин холодильник', 'Первые домашние холодильники появились тоже в середине 19 века. Тогда это были обыкновенные деревянные шкафы, набитые льдом. Через 20 лет, в 1879 году немецкий учёный Карл фон Линде изобрёл холодильную машину с компрессором. Это был механический холодильник, в котором использовался паровой насос.', '987987', '', '[{\"id\":\"000000072\",\"index\":1,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000001\",\"index\":2,\"is_title\":false,\"type\":8,\"value\":\"156\"},{\"id\":\"000000004\",\"index\":3,\"is_title\":false,\"type\":7,\"value\":\"000000004\"},{\"id\":\"000000014\",\"index\":4,\"is_title\":false,\"type\":4,\"value\":\"000000011\"},{\"id\":\"000000025\",\"index\":5,\"is_title\":false,\"type\":4,\"value\":\"000000015\"},{\"id\":\"000000028\",\"index\":6,\"is_title\":false,\"type\":1,\"value\":\"сканер отпечатка пальца; быстрая зарядка; технология распознавания лица\"},{\"id\":\"000000032\",\"index\":7,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000029\",\"index\":8,\"is_title\":false,\"type\":2,\"value\":6.5},{\"id\":\"000000036\",\"index\":9,\"is_title\":false,\"type\":4,\"value\":\"000000039\"},{\"id\":\"000000037\",\"index\":10,\"is_title\":false,\"type\":4,\"value\":\"000000017\"},{\"id\":\"000000038\",\"index\":11,\"is_title\":false,\"type\":3,\"value\":true},{\"id\":\"000000039\",\"index\":12,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000043\",\"index\":16,\"is_title\":false,\"type\":1,\"value\":\"MediaTek Helio G35\"},{\"id\":\"000000044\",\"index\":17,\"is_title\":false,\"type\":2,\"value\":8},{\"id\":\"000000045\",\"index\":18,\"is_title\":false,\"type\":2,\"value\":2000},{\"id\":\"000000046\",\"index\":19,\"is_title\":false,\"type\":4,\"value\":\"000000028\"},{\"id\":\"000000047\",\"index\":20,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000740\",\"index\":26,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000055\",\"index\":2