('000000000020', '00002', '000000006', '', 'Смартфон iPhone 12 Pro 256GB (серебристый)', 'Это iPhone 12 Pro. A14 Bionic, самый быстрый процессор iPhone. Система камер Pro, которая обеспечивает потрясающее качество снимков при слабом освещении. Это новая прекрасная эра для iPhone.', '15875684', '', '[{\"id\":\"000000072\",\"index\":1,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000001\",\"index\":2,\"is_title\":false,\"type\":8,\"value\":\"156\"},{\"id\":\"000000004\",\"index\":3,\"is_title\":false,\"type\":7,\"value\":\"000000011\"},{\"id\":\"000000014\",\"index\":4,\"is_title\":false,\"type\":4,\"value\":\"000000044\"},{\"id\":\"000000028\",\"index\":6,\"is_title\":false,\"type\":1,\"value\":\"сканер отпечатка пальца, разблокировка по лицу\"},{\"id\":\"000000032\",\"index\":7,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000029\",\"index\":8,\"is_title\":false,\"type\":2,\"value\":6.1},{\"id\":\"000000036\",\"index\":9,\"is_title\":false,\"type\":4,\"value\":\"000000046\"},{\"id\":\"000000037\",\"index\":10,\"is_title\":false,\"type\":4,\"value\":\"000000017\"},{\"id\":\"000000038\",\"index\":11,\"is_title\":false,\"type\":3,\"value\":true},{\"id\":\"000000039\",\"index\":12,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000043\",\"index\":16,\"is_title\":false,\"type\":1,\"value\":\"Apple A14 Bionic\"},{\"id\":\"000000044\",\"index\":17,\"is_title\":false,\"type\":2,\"value\":6},{\"id\":\"000000045\",\"index\":18,\"is_title\":false,\"type\":2,\"value\":1700},{\"id\":\"000000046\",\"index\":19,\"is_title\":false,\"type\":4,\"value\":\"000000029\"},{\"id\":\"000000047\",\"index\":20,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000740\",\"index\":26,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000055\",\"index\":28,\"is_title\":false,\"type\":2,\"value\":4810},{\"id\":\"000000877\",\"index\":29,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000019\",\"index\":31,\"is_title\":true,\"type\":0,\"va