('000000000021', '00002', '000000006', '', 'Смартфон iPhone 11 64GB (красный)', 'Ничего лишнего. Только самое. Ярко. Мощно. То, что нужно. Сверхширокоугольный взгляд на мир. iPhone 11. Переходите на самое. Снимайте видео 4K, отличные портреты и захватывающие пейзажи с превосходной системой двух камер. Делайте красивейшие снимки при слабом освещении в Ночном режиме. Смотрите фотографии и видео, играйте в игры - на дисплее Liquid Retina 6,1 дюйма всё выглядит естественно и реалистично. Открывайте новые возможности игр, дополненной реальности и фотографии благодаря невероятной производительности процессора A13 Bionic. А с мощным аккумулятором вы сможете делать больше - и меньше времени тратить на зарядку. Устройство защищено от воды (допускается погружение в воду на глубину до 2 метров на 30 минут). Apple перечисляет часть средств от продажи iPhone 11 (PRODUCT)RED в Глобальный фонд для борьбы со СПИДом.', '16023985', '', '[{\"id\":\"000000072\",\"index\":1,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000001\",\"index\":2,\"is_title\":false,\"type\":8,\"value\":\"156\"},{\"id\":\"000000004\",\"index\":3,\"is_title\":false,\"type\":7,\"value\":\"000000012\"},{\"id\":\"000000014\",\"index\":4,\"is_title\":false,\"type\":4,\"value\":\"000000044\"},{\"id\":\"000000028\",\"index\":6,\"is_title\":false,\"type\":1,\"value\":\"сканер отпечатка пальца, разблокировка по лицу\"},{\"id\":\"000000032\",\"index\":7,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000029\",\"index\":8,\"is_title\":false,\"type\":2,\"value\":6.1},{\"id\":\"000000036\",\"index\":9,\"is_title\":false,\"type\":4,\"value\":\"000000046\"},{\"id\":\"000000037\",\"index\":10,\"is_title\":false,\"type\":4,\"value\":\"000000017\"},{\"id\":\"000000038\",\"index\":11,\"is_title\":false,\"type\":3,\"value\":true},{\"id\":\"000000039\",\"index\":12,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000043\",\"index\":16,\"is_title\":false,\"type\":1,\"value\":\"Apple A14 Bionic\"},{\"id