('000000000025', '00004', '000000006', '', 'Смартфон Samsung Galaxy A72 128Gb (Зеленовато-лимонный)', 'Играть, смотреть фильмы, бродить по сети и работать в многозадачном режиме без перерыва на ярком 6.5-дюймовом sAMOLED экране с FHD+ разрешением. Четыре камеры для снимков с глубокой перспективой. Основная камера 48МП создана для ярких и четких снимков сверхвысокого разрешения днем и ночью. Сверхширокоугольная камера 12МП позволит снять великолепные пейзажи и сделать групповые снимки. Зафиксируйте мельчайшие детали с камерой для макросъемки 5МП, а для создания красивых портретов с эффектом размытия фона достаточно переключиться на камеру 5МП с датчиком глубины и поддержкой режима \"Живой фокус\". Galaxy A51 оснащен быстрым процессором и вместительным хранилищем. Улучшенный 8-ядерный процессор, 4 ГБ оперативной памяти и 64 ГБ встроенной памяти обеспечат плавную и эффективную работу любых приложений.', '14044012', '', '[{\"id\":\"000000072\",\"index\":1,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000001\",\"index\":2,\"is_title\":false,\"type\":8,\"value\":\"704\"},{\"id\":\"000000004\",\"index\":3,\"is_title\":false,\"type\":7,\"value\":\"000000006\"},{\"id\":\"000000014\",\"index\":4,\"is_title\":false,\"type\":4,\"value\":\"000000011\"},{\"id\":\"000000028\",\"index\":6,\"is_title\":false,\"type\":1,\"value\":\"быстрая зарядка; сканер отпечатка пальца; технология распознавания лица\"},{\"id\":\"000000032\",\"index\":7,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000029\",\"index\":8,\"is_title\":false,\"type\":2,\"value\":6.7},{\"id\":\"000000036\",\"index\":9,\"is_title\":false,\"type\":4,\"value\":\"000000040\"},{\"id\":\"000000037\",\"index\":10,\"is_title\":false,\"type\":4,\"value\":\"000000042\"},{\"id\":\"000000038\",\"index\":11,\"is_title\":false,\"type\":3,\"value\":true},{\"id\":\"000000039\",\"index\":12,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000043\",\"index\":16,\"is_title\":false,\"type\":1,\"value\":\"Sn