('000000000028', '00005', '000000006', '', 'Смартфон Nokia 5.4 DS 6/64Gb (фиолетовый)', 'Nokia 5.4 - смартфон с впечатляющими возможностями. 4-сенсорная камера 48 МП и видеоредактор с улучшенными настройками и кинематографическими эффектами для съемки видеороликов с хорошей детализацией. Вы будете успевать всё задуманное, благодаря оптимизированному процессору Qualcomm Snapdragon 662 и батарее, которая держит заряд до двух дней! Смартфон не потеряет актуальности со временем - получит обновление до Android 11 и выше. Работайте и отдыхайте вместе со своим смартфоном.', '18876911', '', '[{\"id\":\"000000072\",\"index\":1,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000001\",\"index\":2,\"is_title\":false,\"type\":8,\"value\":\"156\"},{\"id\":\"000000004\",\"index\":3,\"is_title\":false,\"type\":7,\"value\":\"000000005\"},{\"id\":\"000000014\",\"index\":4,\"is_title\":false,\"type\":4,\"value\":\"000000011\"},{\"id\":\"000000025\",\"index\":5,\"is_title\":false,\"type\":4,\"value\":\"000000015\"},{\"id\":\"000000028\",\"index\":6,\"is_title\":false,\"type\":1,\"value\":\"будильник; фонарик; FM-приёмник\"},{\"id\":\"000000032\",\"index\":7,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000029\",\"index\":8,\"is_title\":false,\"type\":2,\"value\":6.39},{\"id\":\"000000036\",\"index\":9,\"is_title\":false,\"type\":4,\"value\":\"000000051\"},{\"id\":\"000000037\",\"index\":10,\"is_title\":false,\"type\":4,\"value\":\"000000048\"},{\"id\":\"000000038\",\"index\":11,\"is_title\":false,\"type\":3,\"value\":false},{\"id\":\"000000039\",\"index\":12,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000044\",\"index\":17,\"is_title\":false,\"type\":2,\"value\":8},{\"id\":\"000000045\",\"index\":18,\"is_title\":false,\"type\":2,\"value\":2000},{\"id\":\"000000046\",\"index\":19,\"is_title\":false,\"type\":4,\"value\":\"000000028\"},{\"id\":\"000000047\",\"index\":20,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000740\",\"index\":26,\"is