('000000000031', '00005', '000000006', '', 'Смартфон Xiaomi Redmi Redmi 9T 4/64 Gb (кирпичный)', 'Смартфон Xiaomi Redmi 9T оснащен камерой из 4 модулей 48+8+2+2, позволяющей делать снимки с высокой детализацией, отличные панорамные снимки, портреты с эффектом боке и осуществлять макросъёмку. Мощный 8-ядерный процессор обеспечит высокую производительность даже в самых требовательных играх. На дисплее 6.53 дюйма с пониженным излучением в синем спектре комфортно выполнять любые привычные задачи даже при длительном использовании. Два динамика создадут эффект полного погружения при просмотре фильма или игре. Сканер отпечатков пальцев, встроенный в кнопке питания, надежно защитит ваши данные. Емкого аккумулятора на 6000 мАч хватит на 17 часов просмотра видео, 56 часов разговора и на 195 часов прослушивания музыки.', '21379342', '', '[{\"id\":\"000000072\",\"index\":1,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000001\",\"index\":2,\"is_title\":false,\"type\":8,\"value\":\"156\"},{\"id\":\"000000004\",\"index\":3,\"is_title\":false,\"type\":7,\"value\":\"000000008\"},{\"id\":\"000000014\",\"index\":4,\"is_title\":false,\"type\":4,\"value\":\"000000011\"},{\"id\":\"000000025\",\"index\":5,\"is_title\":false,\"type\":4,\"value\":\"000000015\"},{\"id\":\"000000028\",\"index\":6,\"is_title\":false,\"type\":1,\"value\":\"сканер отпечатка пальца; быстрая зарядка; технология распознавания лица\"},{\"id\":\"000000032\",\"index\":7,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000029\",\"index\":8,\"is_title\":false,\"type\":2,\"value\":6.5},{\"id\":\"000000036\",\"index\":9,\"is_title\":false,\"type\":4,\"value\":\"000000039\"},{\"id\":\"000000037\",\"index\":10,\"is_title\":false,\"type\":4,\"value\":\"000000048\"},{\"id\":\"000000038\",\"index\":11,\"is_title\":false,\"type\":3,\"value\":true},{\"id\":\"000000039\",\"index\":12,\"is_title\":true,\"type\":0,\"value\":\"\"},{\"id\":\"000000043\",\"index\":16,\"is_title\":false,\"type\":1,\"value\":\"Media